import { css } from "styled-components";

export const ValignTextMiddle = css`
  display: flex;
  flex-direction: column;
  justify-content: center;
`;

export const ValignTextBottom = css`
  display: flex;
  flex-direction: column;
  justify-content: flex-end;
`;

export const RationaleNormalWhite48px = css`
  color: var(--white);
  font-family: var(--font-family-rationale);
  font-size: var(--font-size-m);
  font-weight: 400;
  font-style: normal;
`;

export const RationaleNormalBlack48px = css`
  color: var(--black);
  font-family: var(--font-family-rationale);
  font-size: var(--font-size-m);
  font-weight: 400;
  font-style: normal;
`;

export const RationaleNormalBlack64px = css`
  color: var(--black);
  font-family: var(--font-family-rationale);
  font-size: var(--font-size-l);
  font-weight: 400;
  font-style: normal;
`;

export const RationaleNormalBlack36px = css`
  color: var(--black);
  font-family: var(--font-family-rationale);
  font-size: var(--font-size-s);
  font-weight: 400;
  font-style: normal;
`;

export const Border2pxBlack = css`
  border: 2px solid var(--black);
`;
